	public static int lengthOfLongestSubstring(String s) {
		if (s == null) {
			return 0;
		}

		int maxLength = 0;
		StringBuilder maxSb = new StringBuilder();

		for (char c : s.toCharArray()) {
			String current = c + "";
			int index = maxSb.indexOf(current);

			if (index != -1) {
				maxLength = Math.max(maxLength, maxSb.length());
				maxSb = maxSb.delete(0, index + 1);
			}
			maxSb.append(current);
		}

		if (maxSb.length() > 0) {
			maxLength = Math.max(maxLength, maxSb.length());
		}

		return maxLength;
	}
